import React from 'react';
import { Card, WingBlank, WhiteSpace,List} from 'antd-mobile';
import {LockOutlined,LogoutOutlined,CustomerServiceOutlined}from '@ant-design/icons'
const Item = List.Item;
const Brief = Item.Brief;
class HomePage extends React.Component {
  constructor(...args) {
	  super(...args);
		this.state={
		}
  }
  render() {
    return (
      <div className="qm-fill-width">
      {/* <div style={{height:"200px",width:'100%',background:"#77ccbb"}}></div> */}

      <div className="qm-main-my-header">
    <WhiteSpace size="md" />
      <WingBlank size="md">
      <Card>
      <Card.Header
        title="This is title"
        thumb="https://gw.alipayobjects.com/zos/rmsportal/MRhHctKOineMbKAZslML.jpg"
        extra={<span>我的哦</span>}
      />
      <Card.Body>
        <div>This is content of `Card`</div>
      </Card.Body>
      <Card.Footer content="footer content" extra={<div>extra footer content</div>} />
    </Card>
    </WingBlank>
      </div>

    <WhiteSpace size="md" />
    <WingBlank size="md">
    <List>
        <Item
          thumb={<LockOutlined className="qm-text-waring mainIcon"/>}
          arrow="horizontal"
          onClick={() => {}}
        >修改密码</Item>
        <Item
          thumb={<CustomerServiceOutlined  className="qm-text-wait mainIcon"/>}
          onClick={() => {}}
          arrow="horizontal"
        >
          联系客服
        </Item>
      </List>

    <WhiteSpace size="lg" />
    <List>
        <Item
          thumb={<LogoutOutlined  className="qm-text-error mainIcon"/>}
          arrow="horizontal"
          onClick={() => {}}
        >退出登录</Item>
      </List>
  </WingBlank>
      </div>
    );
  }
}

export default HomePage;
